import React from "react";
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

function Dialog_item(props){
    return(
        <div>
            <NavLink to="/dialogs/1" activeClassName={s.active}>Yaroslav</NavLink><br/>
        </div>
    )
}

function Dialogs() {
    return (
        <div className={s.content}>
            <div className={s.dialogs}>
                <h1>Dialogs</h1>

                <NavLink to="/dialogs/2" activeClassName={s.active}>Alex</NavLink><br/>
                <NavLink to="/dialogs/3" activeClassName={s.active}>Veronika</NavLink><br/>
                <NavLink to="/dialogs/4" activeClassName={s.active}>Naruto</NavLink><br/>
                <NavLink to="/dialogs/5" activeClassName={s.active}>Tanjiro</NavLink><br/>
                <NavLink to="/dialogs/6" activeClassName={s.active}>Yudzhiro</NavLink>
            </div>
            <div className={s.messages}>
                Hello
                hello
            </div>
        </div>
    )
}

export default Dialogs;
